import React from 'react';
import './Main.css';
import Posts from '../Posts/Posts'

import {Route} from 'react-router-dom'
function Main() {
  return (
    <div className="Main">
       <Route path='/addPosts' component={Posts}/>
    </div>
  );
}

export default Main;
